    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }
      body {
      }
      .main {
        width: 754px;
        height: auto;
        border: solid 1px;
        margin: auto;
        margin-top: 100px;
        background-color: gray;
        display: flex;
        flex-wrap: wrap;
      }
      .main > div {
        display: flex;
        width: 150px;
        height: 170px;
        /* border: solid 0.1px white; */
      }
      .main > div > img {
        /* border-radius: 50%; */
        border-top-left-radius: 30px;
        border-bottom-right-radius: 30px;
      }
      .div1 {
        cursor: pointer;
        transform: rotate(45deg);
        transform: translatey(+100px);
      }
      .div2 {
        cursor: pointer;
        transform: translatey(+100px);
      }
      .div3 {
        cursor: pointer;
        transform: translatex(-100px);
        transform: translatey(+100px);
      }
      .div4 {
        cursor: pointer;
        transform: translatex(+100px);
      }
      .div5 {
        cursor: pointer;
        transform: translate(-100px, -100px);
        transform: translatey(+100px);
      }
      .div6 {
        cursor: pointer;
        transform: translatey(+100px);
        transform: translatey(+0px);
      }
      .div7 {
        cursor: pointer;
        transform: skewy(-45deg);
        transform: translatey(+80px);
      }
      .div8 {
        cursor: pointer;
        transform: skewx(-20deg);
        transform: translatey(+80px);
      }
      .div9 {
        cursor: pointer;
        transform: skew(10deg, 40deg);
      }
      .div10 {
        cursor: pointer;
        transform: skewx(+20deg);
      }
      .div11 {
        cursor: pointer;
        transform: skewy(+30deg);
      }
      .div12 {
        cursor: grab;
        transform: scaley(1.5);
      }
      .div13 {
        cursor: pointer;
        transform: scalex(1.5);
      }
      .div14 {
        cursor: pointer;
        transform: scale(1.4, 1.5);
      }
      .div15 {
        cursor: pointer;
        transform: scaley(0.5);
      }
      .div16 {
        cursor: pointer;
        transform: scalex(0.8);
        transform: translatey(-100px);
      }
      .div17 {
        cursor: pointer;
        transform: rotate(+30deg);
        transform: translatey(-100px);
      }
      .div18 {
        cursor: pointer;
        transform: rotate(-45deg);
        transform: translatey(-100px);
      }
      .div19 {
        cursor: pointer;
        transform: rotate(-60deg);
        transform: translatey(-100px);
      }
      .div20 {
        cursor: pointer;
        transform: rotate(+60deg);
        transform: translatey(-100px);
      }
    </style>
